// src/pages/Integrantes.js
import React from 'react';
import './Integrantes.css'; // Importamos el archivo de estilos

const Integrantes = () => {
    return (
        <div className="integrantes-container">
            <h2>Integrantes del Grupo</h2>
            <div className="cards-container">
                {/* Tarjeta de Alejandro */}
                <div className="card">
                    <img src="ruta-a-la-imagen-de-alejandro.jpg" alt="Alejandro" className="card-image" />
                    <h3>Alejandro</h3>
                    <p>Descripción breve de Alejandro.</p>
                </div>
                {/* Tarjeta de Kevin */}
                <div className="card">
                    <img src="ruta-a-la-imagen-de-kevin.jpg" alt="Kevin" className="card-image" />
                    <h3>Kevin</h3>
                    <p>Descripción breve de Kevin.</p>
                </div>
            </div>
        </div>
    );
};

export default Integrantes;
